import './list.scss';
import ArrowBackIosIcon from '@mui/icons-material/ArrowBackIos';


export default function List() {
  return (
   <div className="list">
       <span className="listTitle">Continue to watch</span>
       <div className="wrapper">
            <ArrowBackIosIcon />
            <ArrowForwardIosOutlined />
       </div>
   </div>
  )
}
